import { Button } from "react-bootstrap";
import "./styles.css";
import './app.scss';

export default function App() {
  return (
    <div className="App">
      <Button >Login </Button>
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
    </div>
  );
}
